import './Relatorios.css'; // Importando o CSS da página Relatórios
import React, { useEffect, useState } from 'react';
import axios from 'axios';

const Relatorios = () => {
  const [livrosMaisEmprestados, setLivrosMaisEmprestados] = useState([]);
  const [usuariosComPendencias, setUsuariosComPendencias] = useState([]);
  const [erro, setErro] = useState(null);

  useEffect(() => {
    // Buscar livros mais emprestados
    const buscarLivrosMaisEmprestados = async () => {
      try {
        const resposta = await axios.get('http://localhost:3001/api/emprestimos/relatorio/livros-mais-emprestados');
        setLivrosMaisEmprestados(resposta.data);
      } catch (erro) {
        setErro('Erro ao buscar livros mais emprestados');
        console.error(erro);
      }
    };

    // Buscar usuários com pendências
    const buscarUsuariosComPendencias = async () => {
      try {
        const resposta = await axios.get('http://localhost:3001/api/emprestimos/relatorio/usuarios-com-pendencias');
        setUsuariosComPendencias(resposta.data);
      } catch (erro) {
        setErro('Erro ao buscar usuários com pendências');
        console.error(erro);
      }
    };

    buscarLivrosMaisEmprestados();
    buscarUsuariosComPendencias();
  }, []);

  return (
    <div className="relatorios">
      <h1>Relatórios</h1>

      <h2>Livros Mais Emprestados</h2>
      {erro && <p>{erro}</p>}
      <table>
        <thead>
          <tr>
            <th>Título</th>
            <th>Autor</th>
            <th>Quantidade</th>
          </tr>
        </thead>
        <tbody>
          {livrosMaisEmprestados.map((livro, index) => (
            <tr key={index}>
              <td>{livro.titulo}</td>
              <td>{livro.autor}</td>
              <td>{livro.count}</td>
            </tr>
          ))}
        </tbody>
      </table>

      <h2>Usuários com Pendências</h2>
      <table>
        <thead>
          <tr>
            <th>Nome</th>
            <th>Email</th>
            <th>Telefone</th>
            <th>Livro</th>
          </tr>
        </thead>
        <tbody>
          {usuariosComPendencias.map((pendencia, index) => (
            <tr key={index}>
              <td>{pendencia.usuario.nome}</td>
              <td>{pendencia.usuario.email}</td>
              <td>{pendencia.usuario.telefone}</td>
              <td>{pendencia.livro.titulo}</td>
            </tr>
          ))}
        </tbody>
      </table>
    </div>
  );
};

export default Relatorios;
const express = require('express');
const router = express.Router();
const emprestimoController = require('../controllers/emprestimoController');

// Rota para listar todos os empréstimos
router.get('/', emprestimoController.getAllEmprestimos);

// Rota para adicionar um empréstimo
router.post('/', emprestimoController.addEmprestimo);

// Rota para registrar devolução
router.put('/:id', emprestimoController.registrarDevolucao);

// Relatório: Livros mais emprestados
router.get('/relatorio/livros-mais-emprestados', emprestimoController.livrosMaisEmprestados);

// Relatório: Usuários com Empréstimos Pendentes
router.get('/relatorio/usuarios-com-pendencias', emprestimoController.usuariosComPendencias);

module.exports = router;
